        /// <summary>
        /// Свойство устройства
        /// </summary>
        [StructLayout(LayoutKind.Sequential)]
        public struct DEVPROPKEY
        {
            /// <summary>
            /// Идентификатор
            /// </summary>
            public Guid formatId;
            /// <summary>
            /// Номер
            /// </summary>
            public UInt32 propertyId;

            public DEVPROPKEY(Guid guid, UInt32 propertyId)
            {
                this.formatId = guid;
                this.propertyId = propertyId;
            }
            public DEVPROPKEY(string formatId, UInt32 propertyId)
                : this(new Guid(formatId), propertyId)
            {
            }
            public DEVPROPKEY(uint a, uint b, uint c, uint d, uint e, uint f, uint g, uint h, uint i, uint j, uint k, UInt32 propertyId)
                : this(new Guid((uint)a, (ushort)b, (ushort)c, (byte)d, (byte)e, (byte)f, (byte)g, (byte)h, (byte)i, (byte)j, (byte)k), propertyId)
            {
            }
            public override bool Equals(object obj)
            {
                DEVPROPKEY ext = (DEVPROPKEY)obj;

                return this.formatId.Equals(ext.formatId) && this.propertyId.Equals(ext.propertyId);
            }

            public override int GetHashCode()
            {
                return this.formatId.GetHashCode() * this.propertyId.GetHashCode();
            }
